import './App.css';

function App() {
  console.log("start to fetch");
  fetch('http://127.0.0.1:8000/api/list')
  .then(data=>data.json())
  .then((json)=>{
    json.map((j)=>console.log(j.name))
  });
  console.log("end of fetch");
  return (
    <>
    </>
  );
}

export default App;
